import { CHANGE_SEARCH_FIELD } from "./actions.js";
const initialState = {
  searchField: "",
};

import React from "react";

export const searchRobots = (state = initialState, action = {}) => {
  switch (action.type) {
    case CHANGE_SEARCH_FIELD:
      return Object.assign({}, state, { searchField: action.payload });
    default:
      return state;
  }
};
